import styled from  'styled-components';
import getBoard from '../Axios/BoardListAxios';

class Board extends Component{

    getBoard = () =>  {
        getBoard();
    }
    render(){
        return(
            <BoardDiv>
                <BoardTable>
                    <Tr>
                        <Th>번호</Th>
                        <Title>제목</Title>
                        <Th>글쓴이</Th>
                    </Tr>
                    <Tr>
                        <Td>1</Td>
                        <Titlesmall>샬라샬라</Titlesmall>
                        <Td>석</Td>
                    </Tr>
                </BoardTable>
               <button type="button" onClick={this.getBoard}>테스트 중입니다</button>
            </BoardDiv>
        )
    }

}

export default Board;
